import React from "react";

const loginLeftSideBar = () => {
  return (
    <div>
      <label>Platfarm</label>
      <label>Welcome,</label>
      <label>Login to Continue</label>
      <input placeholder="Username or phone number"></input>
      <input placeholder="Password"></input>
      <button>Login</button>
      <label>Don't have an account?</label>
    </div>
  );
};

export default loginLeftSideBar;
